import React from 'react';
import '../css/todaydust.css';
import { ReactComponent as KoreaMapSVG } from '../assets/korea_map.svg';


const KoreaMap = ({ dustData }) => {
  const getDustColor = (value) => {
    if (!value) return '#ccc'; // 데이터가 없을 경우 회색
    const numValue = Number(value);
    if (numValue <= 30) return '#00e676'; // 좋음 (초록)
    if (numValue <= 80) return '#ffeb3b'; // 보통 (노랑)
    if (numValue <= 150) return '#ff9800'; // 나쁨 (주황)
    return '#ff1744'; // 매우 나쁨 (빨강)
  };

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 800 1000"
      className="korea-map"
    >
      {/* 서울 */}
      <path
        id="KR-11"
        d="M132.666,290.394L133.241,290.724..."
        fill={getDustColor(dustData['seoul'])}
      />
      {/* 부산 */}
      <path
        id="KR-26"
        d="M330.666,400.394L330.241,400.724..."
        fill={getDustColor(dustData['busan'])}
      />
      {/* 추가 지역 */}
    </svg>
  );
};

export default KoreaMap;
